import java.util.Random;class D{public static void main(String[] args){int w = 0;Random r = new Random();int[] d = new int[200];for(int i=0;i<200;i++){d[i]=r.nextInt(6)+1;}for(int i=0;i<100;i++){if(d[i] > d[i+100]){w++;}else if(d[i] == d[i+100]){}else{w--;}}if(w>0){System.out.println("Dice 1 wins");}else if (w<0) {System.out.println("Dice 2 wins");}else{System.out.println("Its a tie");}}}